const Navbar = () => {
    return(
        <nav class="bg-red-900 relative">
          <div class="container bg-red-900">
            <ul>
              <li class="text-white"><a href="#">Home</a></li>
              <li class="text-white absolute"><a href="#">Gallery</a></li>
            </ul>
          </div>
        </nav>
    )
}



export default Navbar;
